class CalendarTaskDetail {  final num? id;  final String? starttime;  final String? endtime;  final String? tencongviec;  final num? owner;  final String? ownerName;  final num? status;  final num? nguoiduyet;  final String? nguoiduyetName;  final num? lanhdao;  final String? lanhdaoName;  final String? chitiet;  final String? ghichutunguoiduyet;  CalendarTaskDetail({     this.id,     this.starttime,     this.endtime,     this.tencongviec,     this.owner,     this.ownerName,     this.status,     this.nguoiduyet,     this.nguoiduyetName,     this.lanhdao,     this.lanhdaoName,     this.chitiet,    this.ghichutunguoiduyet,  });  factory CalendarTaskDetail.fromJson(Map<String, dynamic> json) {    return CalendarTaskDetail(      id: json['id'],      starttime: json['starttime'],      endtime: json['endtime'],      tencongviec: json['tencongviec'],      owner: json['owner'],      ownerName: json['ownerName'] ?? 'N/A',      status: json['status'],      nguoiduyet: json['nguoiduyet'],      nguoiduyetName: json['nguoiduyetName'] ?? 'N/A',      lanhdao: json['lanhdao'],      lanhdaoName: json['lanhdaoName'] ?? 'N/A',      chitiet: json['chitiet'],      ghichutunguoiduyet: json['ghichutunguoiduyet'],    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'starttime': starttime,      'endtime': endtime,      'tencongviec': tencongviec,      'owner': owner,      'ownerName': ownerName,      'status': status,      'nguoiduyet': nguoiduyet,      'nguoiduyetName': nguoiduyetName,      'lanhdao': lanhdao,      'lanhdaoName': lanhdaoName,      'chitiet': chitiet,      'ghichutunguoiduyet': ghichutunguoiduyet,    };  }}class CalendarTaskResponse {  final bool? status;  final String? message;  final CalendarTaskDetail? data;  CalendarTaskResponse({    this.status,    this.message,    this.data,  });  factory CalendarTaskResponse.fromJson(Map<String, dynamic> json) {    return CalendarTaskResponse(      status: json['status'],      message: json['message'],      data: json['data'] != null ? CalendarTaskDetail.fromJson(json['data']) : null,    );  }  Map<String, dynamic> toJson() {    return {      'status': status,      'message': message,      'data': data?.toJson(),    };  }}